import React from "react";
import userVsOppIcon from '../../assets/images/userVsOppIcon.svg';

const FinalStepContent = (props) => {
    return(
        <div>
            <div className="display_flex space_between flex_align_center">
                <img className="players-icon" src={props.selectedUserAsset && props.selectedUserAsset.img ? props.selectedUserAsset.img : null}/>
                <img className="arrows-icon" src={userVsOppIcon}/>
                <img className="players-icon" src={props.selectedOpponentAsset && props.selectedOpponentAsset.img ? props.selectedOpponentAsset.img : null}/>
            </div>
        </div>
    );
}

export default FinalStepContent;
